function addChordC(b,a){addChord(b,"C",0,function(c){addMute(c,"LowE");addOpenString(c,["G","HighE"]);addFretPress(c,3,"A");addFretPress(c,2,"D");addFretPress(c,1,"H")},a)}function addChordCv2(b,a){addChord(b,"C",5,function(c){addBarre(c,1,"D","H");addFretPress(c,4,["LowE","HighE"]);addFretPress(c,3,"A")},a)}function addChordCv3(b,a){addChord(b,"C",3,function(c){addMute(c,"LowE");addBarre(c,1,"A","HighE");addFretPress(c,3,["G","D","H"])},a)}function addChordCv4(b,a){addChord(b,"C",8,function(c){addBarre(c,1,"LowE","HighE");addFretPress(c,2,"G");addFretPress(c,3,["A","D"])},a)}function addChordCv5(b,a){addChord(b,"C",10,function(c){addMute(c,["LowE","A"]);addFretPress(c,1,"D");addFretPress(c,3,["G","HighE"]);addFretPress(c,4,"H")},a)}function addChordCmaj7(b,a){addChord(b,"Cmaj7",0,function(c){addMute(c,"LowE");addOpenString(c,["G","H","HighE"]);addFretPress(c,3,"A");addFretPress(c,2,"D")},a)}function addChordCadd9(b,a){addChord(b,"Cadd9",0,function(c){addMute(c,"LowE");addOpenString(c,["G"]);addFretPress(c,3,["A","H","HighE"]);addFretPress(c,2,"D")},a)}function addChordCm(b,a){addChord(b,"Cm",3,function(c){addMute(c,"LowE");addBarre(c,1,"A","HighE");addFretPress(c,3,["G","D"]);addFretPress(c,2,"H")},a)}function addChordCis(b,a){addChord(b,"C#",4,function(c){addMute(c,"LowE");addBarre(c,1,"A","HighE");addFretPress(c,3,["D","G","H"])},a)}function addChordCism(b,a){addChord(b,"C#m",4,function(c){addMute(c,"LowE");addBarre(c,1,"A","HighE");addFretPress(c,3,["G","D"]);addFretPress(c,2,"H")},a)};